import React from 'react';
import ReactDOM from 'react-dom';
import './app.css';
import App from './App';
import { BrowserRouter, Route, Router } from "react-router-dom";

ReactDOM.render(
  <React.StrictMode>
    <Router>
      <App />
    </Router>
  </React.StrictMode>,
  document.getElementById("root")
);
